#include <gtest/gtest.h>
#include "../include/BoierMurAlgo.hpp"
#include <climits>
#include <fstream>


TEST(BoierMurTests, SimpleTest) {
    std::string txt = "ABCDEABCDABCE";
    std::string pat = "ABCD";
    std::vector<size_t> arr;

    searchBoierMur(txt, pat, arr);
    
    ASSERT_EQ(2, arr.size());

    ASSERT_EQ(0, searchBoierMur(txt, pat));

    txt = "BCDEABCDABCE";

    ASSERT_EQ(4, searchBoierMur(txt, pat));

    txt = "BCDEBBCDABCE";

    ASSERT_EQ(std::string::npos, searchBoierMur(txt, pat));
}

